import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';

import { Gene } from './library/Gene';
import { Fusion } from './library/Fusion';
import { DynamoDB } from './library/DynamoDB';
import { translate } from './library/utils';

const ddb = new DynamoDB();

var testCases = {
  case0:  '',
  case1: '',
  case2: {
    'ENSMUST00000115201 : ENSMUST00000002487': '',
    'ENSMUST00000132176 : ENSMUST00000002487': '',
    'ENSMUST00000023454 : ENSMUST00000002487': '',
    'ENSMUST00000115205 : ENSMUST00000002487': '',
    'ENSMUST00000064477 : ENSMUST00000002487': '',
    'ENSMUST00000100001 : ENSMUST00000002487': ''
  },
  case3:  '',
  case4: 'ATGGCGGCGCTGAGTGGCGGCGGTGGCAGCAGCAGCGGTGGCGGCGGCGGCGGTGGCGGCGGCGGTGGCGGTGGCGACGGCGGCGGCGGCGCCGAGCAGGGCCAGGCTCTGTTCAATGGCGACATGGAGCCGGAGGCCGGCGCTGGCGCCGCGGCCTCTTCGGCTGCGGACCCGGCCATTCCTGAAGAATTTGCAGCCTTCAAGTAG',
  case5: '',
  case6: 'ATGCCGGTCCGGAAGCAAGAATTTGCAGCCTTCAAGTAG',
};
testCases['case0Protein'] = translate(testCases['case0']);
testCases['case0Protein'] = testCases['case0Protein'].slice(0, testCases['case0Protein'].indexOf('*'));
testCases['case1Protein'] = translate(testCases['case1']);
testCases['case1Protein'] = testCases['case1Protein'].slice(0, testCases['case1Protein'].indexOf('*'));

var createFusion = async (ensemblId1, ensemblId2, j1, j2, ensemblRelease) => {
  var geneData1 = await ddb.getGene(ensemblId1, ensemblRelease);
  var geneData2 = await ddb.getGene(ensemblId2, ensemblRelease);
  var gene1 = new Gene(ensemblId1, geneData1);
  var gene2 = new Gene(ensemblId2, geneData2);

  var seqs = await ddb.getSequences(gene1.getSeqIds(), ensemblRelease);
  gene1.parseSeqs(seqs);

  seqs = await ddb.getSequences(gene2.getSeqIds(), ensemblRelease);
  gene2.parseSeqs(seqs);

  var fusion = new Fusion(gene1, gene2, j1, j2);
  return fusion;
}

it('renders without crashing', () => {
  const div = document.createElement('div');
  ReactDOM.render(<App />, div);
  ReactDOM.unmountComponentAtNode(div);
});

it('can get FGFR2 ensembl id', async () => {

  var geneId = await ddb.getGeneSynonym('FGFR2', 'homo_sapiens_94');
  geneId = geneId.ensembl_gene_id.S.split(';');

  expect(geneId).toContain('ENSG00000066468');
});

it('can fetch and compute FGFR2 gene data, - strand', async () => {

  var ensemblId = 'ENSG00000066468';
  var geneData = await ddb.getGene(ensemblId, 'homo_sapiens_94');
  var gene = new Gene(ensemblId, geneData);

  expect(gene.id).toEqual('ENSG00000066468');
  expect(gene.strand).toEqual('-');
  expect(gene.transcripts.length).toEqual(27);

  var transcript = gene.transcripts.filter(val => val.id === 'ENST00000613048');

  expect(transcript.length).toEqual(1);
  expect(transcript[0].exons.length).toEqual(17);

  //utr
  expect(transcript[0].fivePrimeUtrStart).toEqual(121598458);
  expect(transcript[0].fivePrimeUtrEnd).toEqual(121593818);

  expect(transcript[0].threePrimeUtrStart).toEqual(121479856);
  expect(transcript[0].threePrimeUtrEnd).toEqual(121478334);
});

it('can compute DNM3 UTR coordinates, + strand', async () => {

  var ensemblId = 'ENSG00000197959';
  var geneData = await ddb.getGene(ensemblId, 'homo_sapiens_94');
  var gene = new Gene(ensemblId, geneData);

  expect(gene.id).toEqual(ensemblId);
  expect(gene.strand).toEqual('+');

  var transcript = gene.transcripts.filter(val => val.id === 'ENST00000367731');

  //utr
  expect(transcript[0].fivePrimeUtrStart).toEqual(171841500);
  expect(transcript[0].fivePrimeUtrEnd).toEqual(171841656);

  expect(transcript[0].threePrimeUtrStart).toEqual(172407842);
  expect(transcript[0].threePrimeUtrEnd).toEqual(172412717);
});

it('correctly predicts TMEM87B-MERTK out-of-frame fusion', async () => {

  var fusion = await createFusion('ENSG00000153214', 'ENSG00000153208', 112843681, 112722768, 'homo_sapiens_75');

  expect(fusion.transcripts['ENST00000283206 : ENST00000295408'].effect).toEqual('out-of-frame');
  expect(fusion.transcripts['ENST00000283206 : ENST00000295408'].cdsSeq).toEqual(testCases.case0);
  expect(fusion.transcripts['ENST00000283206 : ENST00000295408'].proteinSeq).toEqual(testCases.case0Protein);
});

it('correctly predicts TMEM87B-MERTK +1 fusion', async () => {

  var fusion = await createFusion('ENSG00000153214', 'ENSG00000153208', 112843681, 112722769, 'homo_sapiens_75');

  expect(fusion.transcripts['ENST00000283206 : ENST00000295408'].effect).toEqual('in-frame (with mutation)');
  expect(fusion.transcripts['ENST00000283206 : ENST00000295408'].cdsSeq).toEqual(testCases.case1);
  expect(fusion.transcripts['ENST00000283206 : ENST00000295408'].proteinSeq).toEqual(testCases.case1Protein);
});

