it('correctly predicts in-frame DLG1-BRAF fusion', async () => {

  var fusion = await createFusion('ENSMUSG00000022770', 'ENSMUSG00000002413', 31684294, 39648486, 'mus_musculus_92');

  var transcripts = [
    'ENSMUST00000100001 : ENSMUST00000002487',
    'ENSMUST00000064477 : ENSMUST00000002487',
    'ENSMUST00000115205 : ENSMUST00000002487',
    'ENSMUST00000023454 : ENSMUST00000002487',
    'ENSMUST00000115201 : ENSMUST00000002487'];

  for (var i = 0; i< transcripts.length; i++) {
    expect(fusion.transcripts[transcripts[i]].effect).toEqual('in-frame');
    expect(fusion.transcripts[transcripts[i]].cdnaSeq).toEqual(testCases.case2[transcripts[i]]);
    expect(fusion.transcripts[transcripts[i]].cdsSeq).toEqual(testCases.case3);
  }
});

